import React, {Component} from 'react';
//dependencias de material ui React components that implement Google's
import propTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { styles} from '../styles/Navegation';


class Navegation extends Component{
  constructor(props){
    super(props);
    state = {
      mobileOpen: false,
    };
  }
  handleDrawerToggle = () => {
    this.setState(state => ({ mobileOpen: !state.mobileOpen }));
  };

  render(){
    const drawer = (
     <div>
       <div className={classes.toolbar} />
       <Divider />
       <List>
         {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
           <ListItem button key={text}>
             <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
             <ListItemText primary={text} />
           </ListItem>
         ))}
       </List>
       <Divider />
       <List>
         {['All mail', 'Trash', 'Spam'].map((text, index) => (
           <ListItem button key={text}>
             <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
             <ListItemText primary={text} />
           </ListItem>
         ))}
       </List>
     </div>
   );

    const { classes } = this.props;
    let content = (
      <div className={classes.root}>
        <AppBar position="static" style={{ backgroundColor: ' #fd5800' }} >
          <Toolbar>
            <IconButton className={classes.menuButton} color="inherit" aria-label="Menu">
              <MenuIcon/>
            </IconButton>
            <Typography  variant="h6" color="inherit">
              Capitalize
            </Typography>
          </Toolbar>
        </AppBar>
      </div>
    );

    return content;
  }
}
Navegation.propTypes = {
  classes: propTypes.object.isRequired,
};
export default withStyles(styles)(Navegation);
